pragma solidity 0.5.7;

import "./interfaces/ViaOracle.sol";
import "./utilities/StringUtils.sol";
import "./interfaces/ViaFactory.sol";
import "./interfaces/ViaCash.sol";
import "./interfaces/ViaBond.sol";
import "abdk-libraries-solidity/ABDKMathQuad.sol";
import "@openzeppelin/upgrades/contracts/Initializable.sol";

contract Oracle is ViaOracle, Initializable {

    using stringutils for *;

    using ABDKMathQuad for uint256;
    using ABDKMathQuad for int256;
    using ABDKMathQuad for bytes16;

    //via factory address
    ViaFactory private factory;

    Request[] requests; //list of requests made to the contract
    uint currentId = 0; //increasing request id
    uint minQuorum = 1; //minimum number of responses to receive before declaring final result
    uint totalOracleCount = 3; // Hardcoded oracle count

    // defines a general api request
    struct Request {
        uint id;                            //request id
        string urlToQuery;                  //API url
        string attributeToFetch;            //json attribute (key) to retrieve in the response
        uint agreedValue;                   //value from key
        mapping(uint => uint) answers;      //answers provided by the oracles
        mapping(address => uint) quorum;    //oracles which will query the answer (1=oracle hasn't voted, 2=oracle has voted)
    }

    //event that triggers oracle outside of the blockchain
    event NewRequest (
        uint id,
        string urlToQuery,
        string attributeToFetch
    );

    //triggered when there's a consensus on the final result
    event UpdatedRequest (
        uint id,
        string urlToQuery,
        string attributeToFetch,
        uint agreedValue
    );

    function initialize(address _factory) external initializer{
        require(address(factory)==address(0x0));
        factory = ViaFactory(_factory);
    }

    //create request for oracles listening to emitted event
    function createRequest (
        string memory _urlToQuery,
        string memory _attributeToFetch
    )
    private returns(uint)
    {
        uint length = requests.push(Request(currentId, _urlToQuery, _attributeToFetch, 0));
        Request storage r = requests[length-1];

        // Hardcoded oracles address
        r.quorum[address(0x19836182a3786CD592523cAB7445325be26c3334)] = 1;
        r.quorum[address(0x19836182a3786CD592523cAB7445325be26c3334)] = 1;
        r.quorum[address(0x19836182a3786CD592523cAB7445325be26c3334)] = 1;
        //0x19836182a3786CD592523cAB7445325be26c3334
        //0xE05A78D713eE1467b3198bde4657DcD2671A0C03
        // launch an event to be detected by oracle outside of blockchain
        emit NewRequest (
            currentId,
            _urlToQuery,
            _attributeToFetch
        );

        // increase request id
        currentId++;

        return currentId-1;
    }

    //called by the oracle to record its answer
    function updateRequest (
        uint _id,
        uint _valueRetrieved
    ) public {

        Request storage currRequest = requests[_id];

        //check if oracle is in the list of trusted oracles
        //and if the oracle hasn't voted yet
        if(currRequest.quorum[address(msg.sender)] == 1){

            //marking that this address has voted
            currRequest.quorum[msg.sender] = 2;

            //iterate through "array" of answers until a position if free and save the retrieved value
            uint tmpI = 0;
            bool found = false;
            while(!found) {
                //find first empty slot
                if(currRequest.answers[tmpI] == 0){
                    found = true;
                    currRequest.answers[tmpI] = _valueRetrieved;
                }
                tmpI++;
            }

            uint currentQuorum = 0;

            //iterate through oracle list and check if enough oracles(minimum quorum)
            //have voted the same answer has the current one
            for(uint i = 0; i < totalOracleCount; i++){
                uint a = currRequest.answers[i];
                uint b = _valueRetrieved;

                if(keccak256(abi.encodePacked(a)) == keccak256(abi.encodePacked(b))){
                    currentQuorum++;
                    if(currentQuorum >= minQuorum){
                        currRequest.agreedValue = _valueRetrieved;
                        emit UpdatedRequest (
                            currRequest.id,
                            currRequest.urlToQuery,
                            currRequest.attributeToFetch,
                            currRequest.agreedValue
                        );
                        //call back 
                        __callback(bytes32(currRequest.id), _valueRetrieved);
                    }
                }
            }
        }
    }

    //oraclize code
    struct params{
        address payable caller;
        bytes32 tokenType;
        bytes32 rateType;
        bytes32 callbackId;
    }

    mapping (bytes32 => params) public pendingQueries;

    event LogResult(address payable caller, 
                    bytes32 myid, 
                    bytes32 tokenType, 
                    bytes32 rateType, 
                    uint result);

    function __callback(
        bytes32 _myid,
        uint _result
    )
        private 
    {
        bytes32 callbackId = _myid;
        params memory mpramas = pendingQueries[_myid];
        delete pendingQueries[_myid];

        if(mpramas.callbackId!="") 
            callbackId = mpramas.callbackId;

        emit LogResult(mpramas.caller, callbackId, mpramas.tokenType, mpramas.rateType, _result);
        
        if(mpramas.tokenType == "Cash"){
            ViaCash(mpramas.caller).convert(callbackId, ABDKMathQuad.fromUInt(_result), mpramas.rateType);
        }
        else if(mpramas.tokenType == "Bond"){
            ViaBond(mpramas.caller).convert(callbackId, ABDKMathQuad.fromUInt(_result), mpramas.rateType);
        }
        else if(mpramas.tokenType == "EthCash"){
            ViaCash(mpramas.caller).convert(callbackId, ABDKMathQuad.fromUInt(_result), mpramas.rateType);
        }
        else if(mpramas.tokenType == "EthBond"){
            ViaBond(mpramas.caller).convert(callbackId, ABDKMathQuad.fromUInt(_result), mpramas.rateType);
        }
    }

    function request(bytes calldata _currency, bytes32 _ratetype, bytes32 _tokenType, address payable _tokenContract)
        external
        returns (bytes32)
    {  
        require(factory.getType(msg.sender) == "ViaCash" || factory.getType(msg.sender) == "ViaBond");
        string memory currency = string(_currency).stringToBytes32().substring(0,18);
        string memory url = factory.getViaOracleUrl();
        if(_ratetype == "er" || _ratetype == "ver"){
            bytes32 queryId = bytes32(createRequest(string(abi.encodePacked(url,"/rates/er/",currency)), "rate"));  
            pendingQueries[queryId] = params(_tokenContract, _tokenType, _ratetype,"");
            return queryId;
        }
        else if(_ratetype == "ir"){
            bytes32 queryId = bytes32(createRequest(string(abi.encodePacked(url,"/rates/ir/",currency)), "rate"));
            pendingQueries[queryId] = params(_tokenContract, _tokenType, _ratetype,"");
            return queryId;
        }
        else if(_ratetype == "ethusd"){
            bytes32 queryId = bytes32(createRequest("https://api.pro.coinbase.com/products/ETH-USD/ticker", "price"));
            pendingQueries[queryId] = params(_tokenContract, _tokenType, _ratetype,"");
            return queryId;
        }
    }

    function setCallbackId(bytes32 _queryId, bytes32 _callbackId) external {
        require(pendingQueries[_queryId].caller==msg.sender);
        pendingQueries[_queryId].callbackId = _callbackId;
    }

    
    //payout fiat
    function payOut(address _issuer, address _client, bytes32 _currency, uint256 _amount) external {
        require(factory.getType(msg.sender) == "ViaCash");
        string memory url = factory.getFiatPayoutUrl();
        string memory issuer = _issuer.addressToString();
        string memory client = _client.addressToString();
        createRequest(string(abi.encodePacked(url,"/api/payout/",_amount,"/",_currency.substring(0,5),"/",issuer,"/",client)), "pay");
    }

}
